%spark
// Original Url 
var a = 0.0
for(w <- test1){
// URL searching
sqlContext.clearCache() // clear memory cache
val t0: Long = nanoTime
//Benchmark: loading and searching 1 url from the file
val df = spark.read.format("parquet").load("/user/xw0078/cs4624/combine1.parquet.gzip")
val filtered = df.filter($"originalUrl" === w(0).toString) 
filtered.rdd.count
val t1: Long = nanoTime
val timecost = (t1 - t0).toDouble / pow(10, 9)
// println("Total Time (seconds):"+timecost.toString)
a = a + timecost
}
println("Average Time (seconds):"+(a/1000).toString)

